import Titulo from "./titulo";

interface LayoutProps {
    titulo: string
    children: any
}

export default function Layout(props: LayoutProps) {
    return (
      <div className={`flex justify-center items-center flex-col w-3/4 bg-white text-gray-800 rounded-md`}>
        <Titulo>{props.titulo}</Titulo>
        <div className="p-5">
          {props.children}
          <div className="flex justify-end">
            <Botao
              className="mb-4 bg-purple-500 text-white"
              onClick={() => novoEvento()}
            >
              Novo evento
            </Botao>
          </div>
        </div>
      </div>
    );
  }
